con:configuration.path:
declare namespace soapenv='http://www.w3.org/2003/05/soap-envelope';
                            declare namespace ns1='http://org.ecodex.backend/1_1/';
                            /soapenv:Envelope/soapenv:Body[1]/*[namespace-uri()='http://org.ecodex.backend/1_1/'
                            and local-name()='sendResponse'][1]/messageID[1]

con:configuration.scriptText:
import groovy.sql.Sql

def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context )

def holder = groovyUtils.getXmlHolder( "SendMessageFromTESTGW1_TO_TESTGW2#Response" )
holder.namespaces["soapenv"] = 'http://www.w3.org/2003/05/soap-envelope'
holder.namespaces["backend"] = 'http://org.ecodex.backend/1_1/'
def messageId = holder.getNodeValues("/soapenv:Envelope/soapenv:Body/backend:sendResponse/messageID")[0]

holder = groovyUtils.getXmlHolder( "listPendingMessages_TESTGW2#Response" )
def sql = Sql.newInstance(context.expand( '${#Project#GatewayEndpoint_receiving.jdbc.url}'), context.expand( '${#Project#GatewayEndpoint_receiving.jdbc.driver}'))
holder.namespaces["soapenv"] = 'http://www.w3.org/2003/05/soap-envelope'
holder.namespaces["backend"] = 'http://org.ecodex.backend/1_1/'
boolean found = false
for( item in holder.getNodeValues( "//soapenv:Body/backend:listPendingMessagesResponse/*[local-name()='messageID']" )){
	sql.eachRow('select * from tb_backend_message where id_message = ? and deleted = 0', [item]) { row ->
		found |= (messageId == row.message_uid)
	}
}
assert found : "Error : The message that has been sent is not in the list of the pending messages"
sql.close()

